// import React from 'react';
import React, { Component } from 'react';

const apiKey = '15e1bbc41548aa6ea02bac4f092efa6f&language=en-US&page=1'

class NowPlaying extends React.Component {

    render(){
        return (
        <React.Fragment>
        <div><h1>{this.props.label}</h1></div>
        <apiKey />
        </React.Fragment>
    );        
    }
}

ReactDOM.render(<NowPlaying label="Save" />, mountNode);








